const reportPattern = /^X:(\d+\.\d+)\s+Y:(\d+\.\d+)\s+Z:(\d+\.\d+)/

io.on('connection', socket => {
  socket.on('start', () => {
    socket.emit('status', {
      ok: true,
      isRunning,
      position: currentPosition,
      isConnected: port !== undefined
    })
  })
  socket.on('connectPrinter', async message => {  

    const ports = await SerialPort.list()
    const portPath = ports.find(port => port.path.includes('/dev/tty.usbmodem'))
  
    if (!portPath) return console.log('Not found')
  
    port = new SerialPort(portPath.path, { baudRate: 115200 })
    const parser = port.pipe(new parsers.Readline({ delimiter: '\n' }))
  
    parser.on('data', line => {
      if(line == "ok"){
        isRunning = false;
        if(queue.length > 0){
          const command = queue.shift()
          console.log(command)
          if(command) port?.write(command)
        }
      }
      if(line.match(reportPattern)){
        const [, x, y, z] = line.match(reportPattern)
        console.log(x, y, z)
        currentPosition.x = Number(x)
        currentPosition.y = Number(y)
        currentPosition.z = Number(z)
        socket.emit('status', {
          ok: true,
          isRunning,
          position: currentPosition,
          isConnected: true
        })
        return
      }
      console.log(line)
    })
    port.on('close', () => {
      isRunning = false
      port = undefined
      socket.emit('status', {
        ok: true,
        isRunning,
        position: currentPosition,
        isConnected: false
      })
    })
    port.write('M154 S1\n')
    port.write('M851 X2.5 Y31.5\n')
    port.write('G28 O\n')
    isRunning = true;
    port.write(`G1 X${currentPosition.x} Y${currentPosition.y} Z${currentPosition.z} F3000\n`)
    isRunning = true;
  })

  socket.on('move', (data: {axis: 'x' | 'y' | 'z', move: number}) => {
    if(isRunning) return socket.emit('status', { ok: false, message: 'Already running', isRunning, position: currentPosition })
    if(!port) return socket.emit('status', { ok: false, message: 'Not connected', isRunning, position: currentPosition })
    if(data.axis != 'x' && data.axis != 'y' && data.axis != 'z') return socket.emit('status', { ok: false, message: 'Invalid axis', isRunning, position: currentPosition })
    if(Number.isNaN(data.move)) return socket.emit('status', { ok: false, message: 'Invalid move', isRunning, position: currentPosition })

    isRunning = true;

    let targetPos = currentPosition

    targetPos[data.axis] = Math.round((targetPos[data.axis] + data.move) * 10) / 10;

    if(targetPos[data.axis] < 0) targetPos[data.axis] = 0;
    if(targetPos.y > 235) targetPos[data.axis] = 235;
    if(targetPos.x > 235) targetPos[data.axis] = 235;
    if(targetPos.z > 235) targetPos[data.axis] = 235;

    port.write(`G0 ${data.axis.toUpperCase()}${targetPos[data.axis]}\n`)
  })

  socket.on('moveTo', ({x, y, z}) => {
    if(isRunning) return socket.emit('status', { ok: false, message: 'Already running', isRunning, position: currentPosition })
    if(!port) return socket.emit('status', { ok: false, message: 'Not connected', isRunning, position: currentPosition })

    isRunning = true;
    port.write(`G0 X${x} Y${y} Z${z}\n`)
  })

  socket.on('cut', () => {
    if(isRunning) return socket.emit('status', { ok: false, message: 'Already running', isRunning, position: currentPosition })
    if(!port) return socket.emit('status', { ok: false, message: 'Not connected', isRunning, position: currentPosition })

    cut(lit, 1.7, 2, 60, 90)

  })
})

