// Auto Home

function cut(data: number[][][], cuttingZ: number, travelOffsetZ: number, angleOfIncidence: number, longSideSize: number) {
  const travelZ = cuttingZ + travelOffsetZ

  const maxWidth = data.flat().map(d => d[0]).reduce((a, b) => a > b ? a : b)
  const maxHeight = data.flat().map(d => d[1]).reduce((a, b) => a > b ? a : b)
  const magnification = (maxWidth > maxHeight ? maxWidth : maxHeight) / longSideSize


  data = data.map(d => d.map(p => [
    round(currentPosition.x+p[0] / magnification, 100),
    round((currentPosition.y+(maxHeight - p[1]) / magnification), 100),
  ]))

  queue.push(`G0 Z${travelZ}\n`)
  data.forEach(d => {
    const startDistance = travelOffsetZ / Math.tan(angleOfIncidence * (Math.PI / 180)) // mmtravelOffsetZangleOfIncidence
    const firstX = d[0][0]
    const firstY = d[0][1]
    const secondX = d[1][0]
    const secondY = d[1][1]

    const angleRad = calcAngle(secondX - firstX, secondY - firstY) * (Math.PI / 180)
    const startX = firstX + startDistance * Math.cos(angleRad)
    const startY = firstY + startDistance * Math.sin(angleRad)
    
    queue.push(`G0 X${startX} Y${startY} Z${travelZ} F3000\n`)
    d.forEach(p => {
      queue.push(`G1 X${p[0]} Y${p[1]} Z${cuttingZ} F600\n`)
    });
    d.slice(0,20).forEach(p => {
      queue.push(`G1 X${p[0]} Y${p[1]} Z${cuttingZ}} F600\n`)
    });
    queue.push(`G0 X${d[d.length - 1][0]} Y${d[d.length - 1][1]} Z${travelZ}\n`)
  })
  queue.push(`G1 X117.5 Y235 Z10 F3000\n`)
  
  if(queue.length > 0){
    const command = queue.shift()
    console.log(command)
    if(command) port?.write(command)
  }
}

function round(n: number, order: number) {
  return Math.round((n) * order) / order
}

function calcAngle(x: number, y: number) {
  return (Math.abs(Math.atan2(y, x) * 360 / (Math.PI * 2) - 180) + 270) % 360
}

